import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import Loading from '../components/UI/loading/loading';
import Pointer from '../components/UI/pointer/pointer';
import server from '../utilites/connection';

function Card({isLoading}) {
  const { id } = useParams();
  const [quarters, setQuarters] = useState({});
  const [error, setError] = useState('');

  useEffect(async () => {
    try {
      const res = await server.get(`/${id}`);
      setQuarters(res.data);
    }
    catch (error) {
      const errormsg = error;
      return errormsg;
    }
  })
  

  return (
  <div>
      {isLoading ? <Loading /> : errormsg ? <div>Error</div> : <div className='innercard'>{quarters.title}</div>}
  </div>
);
}

export default Card;
